- input: "TEXT\x1CC00399220\x1C.TEXT\x1C\x1CF3XN\x1CThe committee has expenses paid
    to individuals that are under contract to Fundraise, to plan and manage GOTV activities
    for the PAC. These payments are made directly to the individual because their
    business is registered as a Sole-proprietor not a Corporation.                                                                                   Statement
    regarding operating expenses:  This committee and not active during all reporting
    periods.  We do however, have some expenses when the committee is not active,
    but we do not maintain an office.  All bookkeeping, campaign report preparation
    and records are maintained by River City Business Services (Rita Copeland), as
    treasurer.  The committee also uses the services of an attorney for their legal
    needs."
